import React from 'react';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<div>123</div>}>
          <Route index element={<div>111</div>} />
          <Route path="teams" element={<div>222</div>}>
            <Route path=":teamId" element={<div>333</div>} />
            <Route path="new" element={<div>444</div>} />
            <Route index element={<div>555</div>} />
          </Route>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
